import React from 'react'
const LeftnavCom = ({el, setCurrentSong, setIsPlaying}) =>{
    function changeSong(){
        setIsPlaying(el)
        setCurrentSong(el)
    }
    return(
        <div className='Bar' onClick={changeSong}>
            <div>
                <img src={el.cover} alt=""/>
            </div>
            <div>
                <h3>{el.name}</h3>
                <p>{el.artist}</p>
            </div>
        </div>
    )
}

export default LeftnavCom
